}
set_up_ssh (){
   #Takes no args.
   #
   #Self explanatory.
   tell_us_what_you_do
   if [ ! -e ~/.ssh/id_${KEYTYPE} ] ; then
      mkdir -p ~/.ssh
      chown $USER ~/.ssh
      chmod 0700 ~/.ssh
      eval $KEYGENCMD
   fi
